import React, { Component } from 'react';

import ButtonGroup from 'react-bootstrap/ButtonGroup';
import Button from 'react-bootstrap/Button';


class MonthNav extends Component {

    render() {
        console.log("MonthNav: ", this.props)

        return (
            <>
                <ButtonGroup aria-label="Basic example">
                    <Button variant="secondary"><i class="fas fa-angle-left"></i></Button>
                    <Button variant="secondary">Moth and Year</Button>
                    <Button variant="secondary" value=">"><i class="fas fa-angle-right"></i></Button>
                </ButtonGroup>
            </>
        )
    }
}

export default MonthNav
